"    window.jwVastExtensionHandlers = {
      skippable: (ads, extensionData) => {
        var hhmmssToSecs = function(hhmmss) {
          var hhmmssSplit = hhmmss.split(':');
          return (+hhmmssSplit[0]) * 60 * 60 + (+hhmmssSplit[1]) * 60 + (+hhmmssSplit[2]);
        }

        var minAdLengthElement = extensionData.getElementsByTagName('MinAdLength')[0];
        if (!minAdLengthElement) {
          return ads;
        }

        var skipOffsetElement = extensionData.getElementsByTagName('SkipOffset')[0];
        if (!skipOffsetElement) {
          return ads;
        }

        var minAdLengthSecs = hhmmssToSecs(minAdLengthElement.textContent);
        var skipOffsetSecs = hhmmssToSecs(skipOffsetElement.textContent);

        for (var i = 0 ; i < ads.length ; i++) {
          var ad = ads[i];
          if (ad.skipoffset) {
            continue;
          }

          if (ad.duration < minAdLengthSecs) {
            continue;
          }

          ad.skipoffset = skipOffsetSecs;
        }
        return ads;
      }
    };"

